import { Row, Col } from 'react-bootstrap';
import { useDispatch } from 'react-redux';
import { fetchRecipes } from '../actions';

const RecipesList = () => {
  return (
    <>
      <Row>
        <Col xs={6} md={4}>
          <h1>Recipes List</h1>
        </Col>
      </Row>
    </>
  )
}

export default RecipesList;
